import React from 'react'
import ReactPlayer from 'react-player'
import "./copadamepisode.css"



export const CopadamEpisodes = () => {



  return (
    
    
    <div className='videocop'>
        
        <ReactPlayer url='./v1.mp4'
                       controls
                       playing={true}
                       muted
                       width="100%"
                       height="100%"
                       onEnded={on}
        />
        
    </div>
  )
}
